const CACHE_NAME="maximelroy-carte-v1";self.addEventListener("install",(t=>{t.waitUntil((async()=>{(await caches.open(CACHE_NAME)).addAll(["./","./index.html","./styles/styles.min.css","./fonts/Rubik.woff2","./manifest.json","./favicon.ico","./icon512.png"])})())})),self.addEventListener("fetch",(t=>{t.respondWith((async()=>{const e=await caches.open(CACHE_NAME),n=await e.match(t.request);if(n)return n;try{const n=await fetch(t.request);return e.put(t.request,n.clone()),n}catch(t){}})())}));